import Link from 'next/link';

import LinkBicameral from '../components/LinkBicameral';
import LinkSecurity from '../components/LinkSecurity';
import LinkUnicameral from '../components/LinkUnicameral.js';



const Committees = () =>{
        return (

     <React.Fragment>
 
      <h1>Comites de Crisis Disponibles</h1> 
      <div className="Badges__container">
 

              <Link ><a href="/comite/unicameral">
                  <LinkUnicameral />
              </a>
              </Link>
  
              <Link ><a href="/comite/bicameral">
                  <LinkBicameral />

              </a>
              </Link>
  
              <Link><a href="/comite/security">
                  <LinkSecurity />
                </a>    
              </Link>
 

        <style jsx>{`          
          .Badges__container {
            width: 100%;
            display: grid ;
            grid-gap: 15px;

            grid-template-columns: repeat(auto-fill, minmax(480px, 1fr));
            height: auto;
            text-align: center;
          }  
          
          
          .Badges_conf-logo {
            margin-bottom: 2rem;
            width: 260px;
          }

          
           a {
            width: 100%;
            text-decoration: none;
          }
          
          


          h1{
            text-align: center;
          }
        `}</style>
      </div>
       </React.Fragment> 
        )

   }   

 
 
 export default Committees;
